import React from 'react'

export default function ProductList() {

  let productList = [
        {"id":"1","name":"shit"},
        {"id":"2","name":"haha"}
  ]

  return (
    <div>
        {
            productList.map(product =>(
                    <div key={product.id}>

                            {product.name} <br/>

                    </div>

            ))
        }
    </div>
  )
}
